import React from "react";
import Tables from "./components/Tables";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/:tableid" component={Tables} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
